// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./DeviceRegistry.sol";

/**
 * @title UsageManager
 * @dev This contract manages serivce usage sessions and handles payments.
 * It is designed for a fixed fee per session, paid in Ether (POL).
 * It uses "Pull instead of Push" pattern for secure payment withdrawals.
 */
contract UsageManager is Ownable {

    // Reference to DeviceRegistry contract
    DeviceRegistry public deviceRegistry;

    // Mapping to store user-specific accumulated balance for withdrawal
    mapping(address => uint256) private balances;

    // Fixed fee charged per session
    uint256 public fixedFee;

    // Event to log when a session starts
    event SessionStarted(bytes32 indexed sessionId, address indexed user, address indexed device, uint256 startTime);

    // Event to log when a session ends
    event SessionEnded(bytes32 indexed sessionId, uint256 endTime, uint256 feePaid);

    // Event to log when a device owner withdraws their earnings
    event Withdrawal(address indexed deviceOwner, uint256 amount);

    /**
     * @dev The constructor sets the inital owner and the address of the Device Registry.
     * @param initialOwner The address that will be the first owner of the contract.
     * @param _deviceRegistryAddress The address of the deployed DeviceRegistry contract.
     * @param _initialFixedFee The initial fixed fee charged per session.
     */
    constructor(address initialOwner, address _deviceRegistryAddress, uint256 _initialFixedFee) Ownable(initialOwner){
        deviceRegistry = DeviceRegistry(_deviceRegistryAddress);
        fixedFee = _initialFixedFee;
    }

    /**
     * @dev set the fixed fee for a session.
     * This function is restricted to the contract owner.
     * @param _newFee the new fee to be set
     */
    function setFixedFee(uint256 _newFee) external onlyOwner {
        require(_newFee > 0, "Fee must be greater than zero");
        fixedFee = _newFee;
    }

    /**
     * @dev Starts a new usage session. The user sends the fixed fee with this transaction.
     * The payment is secured and held by the contract.
     * @param _deviceAddress The address of the device being used.
     * @return sessionId Unique session ID for tracking.
     */
    function startSession(address _deviceAddress) external payable returns (bytes32 sessionId) {
        
        // Ensure the device exists and is active
        require(deviceRegistry.isDeviceActive(_deviceAddress), "Device is not active or not found");

        // Ensure the user sent the correct fee.
        require(msg.value == fixedFee, "Incorrect fee sent");

        // Generate a unique session ID based on the user's address and timestamp.
        sessionId = keccak256(abi.encodePacked(msg.sender, _deviceAddress, block.timestamp));

        //Emit an event to log the session start.
        emit SessionStarted(sessionId, msg.sender, _deviceAddress, block.timestamp);
    }

    /**
     * @dev Ends a usage session and credits the device owner's balance.
     * The function should be called by a trusted off-chain service or device itself to confirm session completion.
     * @param _deviceAddress The address of the device that provided the service.
     * @param _userAddress The address of the user who used the service.
     */
    function endSession(address _deviceAddress, address _userAddress) external {

        // Get the device owner from the registry
        address deviceOwner = deviceRegistry.getDeviceOwner(_deviceAddress);
        require(deviceOwner != address(0), "Invalid device owner address");

        // Credit the device owner's balance with the fixed fee
        balances[deviceOwner] += fixedFee;

        // Emit event to log the session end
        emit SessionEnded(keccak256(abi.encodePacked(_userAddress, _deviceAddress, block.timestamp)), block.timestamp, fixedFee);

    }

    /**
     * @dev Allows device owners to withdraw their accumulated earnings.
     * This uses a "pull instead of push" pattern for security. Users "pull" their funds rather than the contract "pushing" them, helps with re-entrancy attacks.
     */
    function withdraw() external {

        // Get the caller's balance
        uint256 amount = balances[msg.sender];
        // Ensure that user has positive balance to withdraw
        require(amount > 0, "No balance to withdraw");

        // Reset the balance to 0 before sending the Ether to prevent re-entrancy
        balances[msg.sender] = 0;

        // Transfer the fee
        (bool success, ) = payable(msg.sender).call{value: amount}("");
        require(success, "Withdrawal failed");

        // Emit event to log successful withdrawal
        emit Withdrawal(msg.sender, amount);
    }

    /**
     * @dev Gets the accumulated balance for a specific address.
     * @param _deviceOwner THe address to query.
     * @return The current balance.
     */
    function getBalance(address _deviceOwner) external view returns (uint256) {
        return balances[_deviceOwner];
    }
}

